BEGIN TRANSACTION;
CREATE TABLE 'galleries' ( 'id' INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, 'name' TEXT, 'description' TEXT, 'cover_image' TEXT, 'owner_id' INTEGER, 'timestamps' DATETIME DEFAULT CURRENT_TIMESTAMP );
CREATE TABLE 'password_resets' ('email' TEXT, 'token' TEXT, 'created_at' DATETIME DEFAULT CURRENT_TIMESTAMP);
CREATE TABLE 'photos' ('id' INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, 'title' TEXT, 'description' TEXT, 'location' TEXT, 'image' TEXT, 'gallery_id' INTEGER, 'owner_id' INTEGER, 'timestamps' DATETIME DEFAULT CURRENT_TIMESTAMP);
CREATE TABLE 'users' ('id' INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, 'name' TEXT, 'email' TEXT, 'password' TEXT,'remember_token' TEXT, 'updated_at' DATETIME DEFAULT CURRENT_TIMESTAMP, 'created_at' DATETIME DEFAULT CURRENT_TIMESTAMP);
DELETE FROM "sqlite_sequence";
COMMIT;
